import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import Table from 'react-responsive-data-table';
import { render } from "react-dom";


render(
  <Table
    style={{
      opacity: 0.8,
      backgroundColor: "#00113a",
      color: "#ffffff",
      textAlign: "center"
    }}
    tableStyle="table table-hover table-striped table-bordered table-borderless table-responsive"
    pages={true}
    onRowClick={row => console.log(row)}
    pagination={true}
    page={true}
    title="Customers"
    search={true}
    errormsg="Error. . ."
    loadingmsg="Loading. . ."
    isLoading={false}
    sort={true}
    //totalPages={27}  removed
    size={10}
    data={{
      head: {
        customerName: "Customer Name",
        address: "Address",
        vehicleid: "Vehicle ID",
        regnum: "Registration Number",
        status: "Status"
      },
      data: [
        {
          id: "Kalles Grustransporter AB",
          name: "Cementvägen 8, 111 11 Södertälje",
          email: "YS2R4X20005399401",
          regnum: "ABC123",
          orders: "CONNECTED"
        }
      ]
    }}
  />,
  document.getElementById("root")
);


// If you want to start measuring performance in your app, pass a function
